import React from "react";
import BannerImage from "../Banner Image /image-banner";
import img from "../../src/assest/cycle.png";
import mobileImge from '../../src/assest/mb-cycle.gif'
// import { Link } from 'gatsby
import './Banner.css'
import { ReactComponent as Logo } from '../assest/arr.svg';

const Banner = () => {
  return (
    <div className="banner-container">
      <BannerImage
        src={img}
        aspectRatio={{ desktop: "1920:923" }}
      />
        <BannerImage
        src={mobileImge}
        aspectRatio={{ mobile: "360:736" }}
      />
      <div className="text-on-image">
        <div className="text">
          <p> BUILT FOR URBAN ADVENTURES & BEYOND</p>
        </div>
        <div className="btn-container">
          <button className="btn-onimage"> EXPLORE <Logo className="arrow"/></button>

        </div>
      </div>
    </div>
  );
};

export default Banner;
